import NavBar from "../components/NavBar";
import React, { useEffect, useState, Component } from "react";
import { useNavigate } from "react-router-dom";
import Cookies from "js-cookie";
import BasicLineChart from "../components/LineChart";
import '../styles/Model.css';


export const validateValues = (inputValues) => {
    let errors = {};

    if (inputValues.month1 < 0 || inputValues.month2 < 0 || inputValues.month3 < 0 ||
        inputValues.astma < 0 || inputValues.pochp < 0 || inputValues.sold < 0) {
        errors.nums = "All fields should be higher than 0";
    }

    return errors;
};

export default function Model() {
    const navigate = useNavigate();

    const [authenticated, setauthenticated] = useState(null);
    const [submitting, setSubmitting] = useState(false);
    const [inputFields, setInputFields] = useState({
        product: "",
        month: "",
        month1: "",
        month2: "",
        month3: "",
        astma: "",
        pochp: "",
        sold: "",
    });
    const [errors, setErrors] = useState({
        product: "",
        month: "",
        nums: "",
    });
    const [xValues, setXValues] = useState([1, 2, 3, 4, 5, 6]);
    const [yValues, setYValues] = useState([40, 80, 60, 35, 22, 90]);



    useEffect(() => {
        setauthenticated(Cookies.get("authenticated") === "true" ? true : false);
        navigate("/SignIn")
    }, []);



    const handleChange = (e) => {
        const { name, value } = e.target;
        setInputFields({ ...inputFields, [name]: value });
        console.log(inputFields.month);
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        setErrors(validateValues(inputFields));
        setSubmitting(true);
    };

    useEffect(() => {
        if (Object.keys(errors).length === 0 && submitting) {
            RequestResult();
        }
    }, [errors]);

    const RequestResult = async () => {
        const requestOptions = {
            method: "POST",
            headers: { "Content-Type": "application/json", 'Authorization': 'Bearer ' + Cookies.get("token").toString() },
            body: JSON.stringify({
                inputFields
            })
        };
        const response = await fetch("http://localhost:3000/model/", requestOptions);
        const data = await response.json();

        if (!response.ok) {

        }
        else {
            SetupPlotValues(data.prediction_value);
        }
    }

    const SetupPlotValues = (prediction_value) => {

        let y = [inputFields.month3, inputFields.month2, inputFields.month1, prediction_value];

    }
    if (authenticated) {
        return (
            <>
                <NavBar />

                <h1 className="h1">Model</h1>
                <BasicLineChart X={xValues} Y={yValues} height={300} />
                <form onSubmit={handleSubmit}>
                    <div className="model-input-container">
                        <br /><br />
                        <select className="model-select" name="Product" id="prod" placeholder="Product">
                            <option value="Product">Select a product</option>
                        </select>
                        <input type="month"  placeholder="Month"                      name="input4"  required className="model-input-month" onChange={handleChange} min="2020-01" max="2025-12"/>
                        <input type="number" placeholder="Sold Units 1 Month Before"  name="input3"  required className="model-input"       onChange={handleChange} min={0}/>
                        <input type="number" placeholder="Sold Units 2 Months Before" name="input4"  required className="model-input"       onChange={handleChange} min={0}/>
                        <input type="number" placeholder="Sold Units 3 Months Before" name="input4"  required className="model-input"       onChange={handleChange} min={0}/>
                        <input type="number" placeholder="Visits POChP"               name="input4"  required className="model-input"       onChange={handleChange} min={0}/>
                        <input type="number" placeholder="Visits ASTMA"               name="input4"  required className="model-input"       onChange={handleChange} min={0}/>
                        <input type="number" placeholder="Sold Products Whole Period" name="input4"  required className="model-input"       onChange={handleChange} min={0}/>
                    </div>
                    <br /><br />
                    <div className="button-container">
                        <input type="submit" className="model-submit-button" />
                    </div>
                </form>
            </>
        )
    }
    else {
        navigate("/SignIn");
    }

}
